import React, {useState, useEffect} from 'react';
import styled from 'styled-components';

const Container = styled.div`
  flex: 1;
  min-height: 700px;
  background-color: lightblue;
  display: flex;
  align-items: center;
  justify-content: center;
`;
const H1 = styled.h1`
  font-weight: bold;
  font-size: 30px;
`;

const Title = () => {
  return (
    <Container>
      <H1> Harrison Lau </H1>
    </Container>
  );
};

export default Title;
